As an Iranian American, I do not and cannot support the idea of a totalitarian monarchy for Iran. However, as an artist, I deeply admire Farah Diba for her invaluable contributions to Iranian art and culture. In my perspective, the 1979 revolution seemed to be driven by a pervasive fear of powerful women, including Farah Diba. Her influence as a cultural ambassador and her humanitarian role in Iran were remarkable, even leaving her own dictator husband concerned. Farah Diba’s grace, influence, and impact on Iranian society are in stark contrast to the oppressive nature of the current regime. Therefore, any attempt to draw comparisons between the two would be unjustifiable. 
به عنوان یک ایرانی آمریکایی، نه می‌خواهم و نه می‌توانم که از ایده یک سلطنت توتالیتاریستی برای ایران حمایت کنم. اما به عنوان یک هنرمند، از فرح دیبا به خاطر سهم بی‌قیمتی که در هنر و فرهنگ ایران داشته است، بسیار تحسین می‌کنم. در نگاه من، انقلاب سال ۱۳۵۷ بنظر می‌رسد تحت تأثیری از ترس گسترده از زنان قدرتمند، از جمله فرح دیبا، بوده است. تأثیر وی به عنوان سفیر فرهنگی و نقش بشردوستانه اش در ایران بسیار قابل تحسین بوده است، حتی طوری که شوهر دیکتاتور خود را نیز با نگرانی مواجه کرده است. زیبایی، تأثیر و تأثیرگذاری فرح دیبا بر جامعه ایران با طبیعت سرکوبگری رژیم فعلی ضدتطابق دارد. بنابراین، هر تلاشی برای مقایسه بین این دو به طور ناعادلانه خواهد بود.
